import React from 'react'
import '../App.css'
import image1 from '../image/logo.png'
const signup = (props) => {
     return(
        <form id="form" method="POST" action="" >
        <img className="logo" src={image1} />
        <input placeholder="پست الکترونیک" dir="ltr" className="text-center"/>
        <input placeholder="انتخاب گذرواژه" dir="ltr" className="text-center"/>
        <input placeholder="تکرار گذرواژه" dir="ltr" className="text-center"/>
        <button className="btn" type="submit"><span>ثبت نام</span></button>
        
      </form>
     );
}
export default signup;
